function App() {
  return (
    <div className="App">
    <div>
      <div>Increment & Decrement</div>
      </div>
      <button>-</button>

    <div>
      <button>+</button>
    </div>
    <div>
      <button>Reset</button>
    </div>
    </div>
  );
}

export default App;
